<p>在使用檢定方法的時候，都會有資料的假設，像是資料服從常態分布等等。但拿到的資料不一定這麼剛好都符合這些假設，所以要先經過處理才能做檢定。資料的偏度（Skewness）是指資料的分布不對稱，可能會影響統計分析的結果。</p>
